Docs.example:
This sample shows how to call BatchCreate.
Uri endpoint = new Uri("<https://my-service.azure.com>"); TokenCredential credential = new DefaultAzureCredential(); TypeDefinition client = new DataMapClient(endpoint, credential).GetTypeDefinitionClient();
AtlasTypesDef atlasTypesDef = new AtlasTypesDef(); Response<AtlasTypesDef> response = client.BatchCreate(atlasTypesDef);
